"use strict";(self.webpackChunksmartlink_doc=self.webpackChunksmartlink_doc||[]).push([[7886],{9547:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"vaultysid/version/2.0","metadata":{"permalink":"/en/vaultysid/vaultysid/version/2.0","source":"@site/blog/VaultysID/2024/2024-08-14-vaultysid-version-2.0/index.mdx","title":"VaultysID 2.0","description":"Rappels pour effectuer des backups","date":"2024-08-14T00:00:00.000Z","tags":[{"inline":true,"label":"vaultysid","permalink":"/en/vaultysid/tags/vaultysid"}],"readingTime":1.005,"hasTruncateMarker":false,"authors":[{"name":"J\xe9r\xf4me Delaire","title":"Lead Dev","url":"https://github.com/JeromeDelaire","imageURL":"/en/img/jerome.png","key":"jerome","page":null}],"frontMatter":{"slug":"vaultysid/version/2.0","title":"VaultysID 2.0","authors":["jerome"],"tags":["vaultysid"]},"unlisted":false,"lastUpdatedAt":1723643471000,"nextItem":{"title":"VaultysID 1.2","permalink":"/en/vaultysid/vaultysid/version/1.2"}},"content":"## Rappels pour effectuer des backups\\n\\n![Suggest backup](suggest-backup.png)\\n\\nNous vous recommandons de r\xe9guli\xe8rement effectuer un backup de vos profils VaultysID.\\n\\nVos backups vous permettent de restaurer vos identit\xe9s sur un nouvel appareil en cas de perte, casse, ou vol.\\n\\nLa version 2.0 de VaultysID int\xe8gre des rappels pour vous aider \xe0 effectuer vos backups r\xe9guli\xe8rement.\\n\\nUn rappel sera effectu\xe9 chaque mois, sauf si vous cochez la case \'Ne plus me demander\'.\\n\\n## Plus de param\xe8tres\\n\\n<img src=\\"/img/blog/2024-08-14-version-2.0/settings.png\\" alt=\\"Param\xe8tres\\" width=\\"375px\\" />\\n\\nDans les param\xe8tres appara\xeet d\xe9sormais une nouvelle langue repr\xe9sent\xe9e par un globe. VaultysID emp\xeachera par d\xe9faut les traducteurs automatiques (ex google trad), en s\xe9lectionnant le globe vous autorisez votre traducteur \xe0 traduire l\'application. Cela permet donc d\'avoir une traduction approximative dans d\'autres langues.\\n\\nUn nouveau menu \\"Aide\\" appara\xeet \xe9galement. Cliquez dessus pour acc\xe9der \xe0 la page d\'aide de VaultysID :\\n\\n<img src=\\"/img/blog/2024-08-14-version-2.0/help.png\\" alt=\\"Aide\\" width=\\"375px\\" />\\n\\n## Simplification de l\'onboarding\\n\\nAu premier lancement de l\'application, la proc\xe9dure d\'enrollement a \xe9t\xe9 grandement simplifi\xe9e.\\n\\n<div className=\\"flex flex-row gap-4 flex-wrap\\">\\n  <img src=\\"/img/blog/2024-08-14-version-2.0/onboarding.step.1.png\\" alt=\\"onboarding1\\" width=\\"250px\\" />\\n  <img src=\\"/img/blog/2024-08-14-version-2.0/onboarding.step.2.png\\" alt=\\"onboarding2\\" width=\\"250px\\" />\\n  <img src=\\"/img/blog/2024-08-14-version-2.0/onboarding.step.3.png\\" alt=\\"onboarding3\\" width=\\"250px\\" />\\n</div>\\n\\n## S\xe9curit\xe9\\n\\nLe procotole de Vaultys a \xe9t\xe9 mis \xe0 jour dans le but d\'am\xe9liorer toujours plus votre s\xe9curit\xe9."},{"id":"vaultysid/version/1.2","metadata":{"permalink":"/en/vaultysid/vaultysid/version/1.2","source":"@site/blog/VaultysID/2024/2024-04-08-vaultysid-version-1.2/index.mdx","title":"VaultysID 1.2","description":"Am\xe9lioration de l\'interface graphique","date":"2024-04-08T00:00:00.000Z","tags":[{"inline":true,"label":"vaultysid","permalink":"/en/vaultysid/tags/vaultysid"}],"readingTime":0.445,"hasTruncateMarker":false,"authors":[{"name":"J\xe9r\xf4me Delaire","title":"Lead Dev","url":"https://github.com/JeromeDelaire","imageURL":"/en/img/jerome.png","key":"jerome","page":null}],"frontMatter":{"slug":"vaultysid/version/1.2","title":"VaultysID 1.2","authors":["jerome"],"tags":["vaultysid"]},"unlisted":false,"lastUpdatedAt":1724517205000,"prevItem":{"title":"VaultysID 2.0","permalink":"/en/vaultysid/vaultysid/version/2.0"},"nextItem":{"title":"VaultysID 1.1","permalink":"/en/vaultysid/vaultysid/version/1.1"}},"content":"## Am\xe9lioration de l\'interface graphique\\n\\nL\'interface graphique a \xe9t\xe9 retravaill\xe9e pour \xeatre plus agr\xe9able, plus uniforme et plus anim\xe9e !\\nNous avons notamment utilis\xe9 des composants standards bas\xe9s sur une exp\xe9rience abouti\xe9 de l\'exp\xe9rience utilisateur.\\nNous sommes certains que vous apr\xe9cierez !\\n\\n<div className=\\"flex flex-row gap-4\\">\\n  <img src=\\"/img/blog/2024-04-08-vaultysid-version-1.2/dashboard.png\\" alt=\\"Light mode\\" width=\\"375px\\" />\\n  <img src=\\"/img/blog/2024-04-08-vaultysid-version-1.2/home.png\\" alt=\\"Dark mode\\" width=\\"375px\\" />\\n</div>\\n\\n## Code PIN\\n\\nEn code PIN est d\xe9sormais obligatoire pour cr\xe9er votre identit\xe9 Vaultys lorsque vous s\xe9l\xe9ctionnez le mode \\"logiciel\\" comme type de profil.\\n\\n<img src=\\"/img/blog/2024-04-08-vaultysid-version-1.2/onboarding.step.9.png\\" alt=\\"Dark mode\\" width=\\"375px\\" />"},{"id":"vaultysid/version/1.1","metadata":{"permalink":"/en/vaultysid/vaultysid/version/1.1","source":"@site/blog/VaultysID/2024/2024-02-29-vaultysid-version-1.1/index.mdx","title":"VaultysID 1.1","description":"Toute l\'\xe9quipe de Vaultys est heureuse de vous pr\xe9senter un nouvelle version de VaultysID, compl\xe8tement r\xe9\xe9crite pour int\xe9grer notre nouvelle Charte Graphique.","date":"2024-02-29T00:00:00.000Z","tags":[{"inline":true,"label":"vaultysid","permalink":"/en/vaultysid/tags/vaultysid"}],"readingTime":0.83,"hasTruncateMarker":false,"authors":[{"name":"J\xe9r\xf4me Delaire","title":"Lead Dev","url":"https://github.com/JeromeDelaire","imageURL":"/en/img/jerome.png","key":"jerome","page":null}],"frontMatter":{"slug":"vaultysid/version/1.1","title":"VaultysID 1.1","authors":["jerome"],"tags":["vaultysid"]},"unlisted":false,"lastUpdatedAt":1724517205000,"prevItem":{"title":"VaultysID 1.2","permalink":"/en/vaultysid/vaultysid/version/1.2"}},"content":"Toute l\'\xe9quipe de Vaultys est heureuse de vous pr\xe9senter un nouvelle version de VaultysID, compl\xe8tement r\xe9\xe9crite pour int\xe9grer notre nouvelle Charte Graphique.\\nNous avons int\xe9gr\xe9 aussi la possibilit\xe9 de personnaliser votre avatar et aussi ajouter la sauvegarde de votre compte.\\n\\n## Nouvelle charte graphique\\n\\nLe charte graphique de Vaultys a \xe9t\xe9 retravaill\xe9e. Couleur, sombre, clair. L\'interface de VaultysID change pour respecter cette nouvelle charte !\\n\\n<div className=\\"flex flex-row gap-4\\">\\n  <img src=\\"/img/blog/2024-02-29-vaultysid-version-1.1/DashboardLight.png\\" alt=\\"Light mode\\" width=\\"375px\\" />\\n  <img src=\\"/img/blog/2024-02-29-vaultysid-version-1.1/DashboardDark.png\\" alt=\\"Dark mode\\" width=\\"375px\\" />\\n</div>\\n\\n## Avatar\\n\\nVous pouvez d\xe9sormais utiliser un avatar et le personnaliser pour repr\xe9senter vos identit\xe9s Vaultys !\\nNous avons choisi quelques chose de simple pour vous repr\xe9senter.\\nDans le futur nous allons it\xe9rer pour donner encore plus de possibilit\xe9s.\\n\\n<img src=\\"/img/blog/2024-02-29-vaultysid-version-1.1/Start.png\\" alt=\\"avatar\\" width=\\"375px\\" />\\n\\n## Importer/Exporter\\n\\nIl est d\xe9sormais possible d\'effectuer un backup de vos profils et de les r\xe9importer.\\nTr\xe8s utile en cas de perte, vol ou casse de votre t\xe9l\xe9phone, nous recommandons de r\xe9guli\xe8rement sauvegarder un backup de vos identit\xe9s Vaultys !"}]}}')}}]);